using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

using FluentAssertions;
using Taka.App.Deliverer.Application.Services;
using Taka.App.Deliverer.Domain.Interfaces;
using Taka.App.Deliverer.Domain.Requests;
using Taka.App.Deliverer.Domain.Responses;
using Taka.App.Deliverer.Domain.Exceptions;
using Taka.App.Deliverer.Application.Services.Apis;
using Taka.Common.Middlewares.Enums;
using NSubstitute;
using Taka.App.Deliverer.Domain.Entities;

namespace Taka.App.Deliverer.Tests.Services
{
    public class DelivererServiceTests
    {
        private readonly DelivererService _delivererService;
        private readonly IDelivererRepository _delivererRepository = Substitute.For<IDelivererRepository>();
        private readonly IStorageService _storageService = Substitute.For<IStorageService>();
        private readonly IRentalsApiService _rentalsApiService = Substitute.For<IRentalsApiService>();

        public DelivererServiceTests()
        {
            _delivererService = new DelivererService(_delivererRepository, _storageService, _rentalsApiService);
        }

        [Fact]
        public async Task AddAsync_ShouldCreateAndReturnDelivererResponse()
        {
            // Arrange
            var request = new DelivererCreateRequest(            
                "John Doe",
                "12345678901234",
                "ABCDE12345",
                CnhValidType.A,
                DateOnly.FromDateTime(DateTime.UtcNow.AddYears(-25)),
                "");
            var expectedUrl = "http://example.com/cnh_image.png";
            _storageService.UploadFileAsync(Arg.Any<byte[]>(), Arg.Any<string>()).Returns(expectedUrl);

            // Act
            var result = await _delivererService.AddAsync(request);

            // Assert
            result.Should().BeOfType<DelivererResponse>();
            result.Cnh.Should().Be(request.Cnh);
            _delivererRepository.Received(1).AddAsync(Arg.Any<PersonDelivery>());
        }

        [Fact]
        public async Task DeleteAsync_ShouldThrowException_IfDelivererHasRentals()
        {
            // Arrange
            var delivererId = Guid.NewGuid();
            _delivererRepository.GetByIdAsync(delivererId).Returns(new PersonDelivery { Id = delivererId });
            _rentalsApiService.ExistRentals(delivererId).Returns(true);

            // Act
            Func<Task> act = async () => { await _delivererService.DeleteAsync(delivererId); };

            // Assert
            await act.Should().ThrowAsync<AppException>()
                .WithMessage("It is not possible to delete this delivery person. There is one or more rentals made by him.");
        }

        [Fact]
        public async Task GetAllAsync_ShouldReturnAllDeliverers()
        {
            // Arrange
            var deliverers = new List<PersonDelivery>
            {
                new PersonDelivery { Id = Guid.NewGuid(), Name = "John Doe", CNPJ = "12345678901234", CNHNumber = "ABCDE12345", CNHType = CnhValidType.A, BirthDate = DateOnly.FromDateTime(DateTime.UtcNow.AddYears(-25)) },
                new PersonDelivery { Id = Guid.NewGuid(), Name = "Jane Doe", CNPJ = "23456789012345", CNHNumber = "ABCDE67890", CNHType = CnhValidType.B, BirthDate = DateOnly.FromDateTime(DateTime.UtcNow.AddYears(-30)) }
            };
            _delivererRepository.GetAllAsync().Returns(deliverers);

            // Act
            var results = await _delivererService.GetAllAsync();

            // Assert
            results.Should().HaveCount(deliverers.Count);
            results.Select(r => r.Id).Should().Contain(deliverers.Select(d => d.Id));
        }

        [Fact]
        public async Task UpdateAsync_ShouldUpdateDelivererImage()
        {
            // Arrange
            var delivererId = Guid.NewGuid();
            var newImage = "newBase64Image==";
            var expectedUrl = "http://example.com/new_cnh_image.png";
            _delivererRepository.GetByIdAsync(delivererId).Returns(new PersonDelivery { Id = delivererId, CNHNumber = "ABCDE12345" });
            _storageService.UploadFileAsync(Arg.Any<byte[]>(), Arg.Any<string>()).Returns(expectedUrl);

            // Act
            await _delivererService.UpdateAsync(new DelivererUpdateRequest(delivererId, newImage));

            // Assert
            _delivererRepository.Received(1).UpdateAsync(Arg.Is<PersonDelivery>(d => d.CNHImageUrl == expectedUrl));
        }
    }
}

